import { HttpErrorResponse } from '@angular/common/http';
import { Component } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { ComplicationThoraciqueAigu } from 'src/app/models/ComplicationThoraciqueAigu';
import { ThoraciqueService } from 'src/app/services/thoracique.service';
import { forkJoin, Observable } from 'rxjs';

@Component({
  selector: 'app-updatethoracique',
  templateUrl: './updatethoracique.component.html',
  styleUrls: ['./updatethoracique.component.css']
})
export class UpdatethoraciqueComponent {
  complications: any[] = [];
  errorMessage: string = '';

  constructor(
    private ThoraciqueService: ThoraciqueService,
    private router: Router,
    private route: ActivatedRoute
  ) {}

  ngOnInit(): void {
    this.route.paramMap.subscribe(params => {
      const PatientID = params.get('PatientID');
      if (PatientID) {
        const id = parseInt(PatientID, 10);
        if (!isNaN(id)) {
          this.getById(id);
        } else {
          console.error('Invalid patient ID:', PatientID);
        }
      } else {
        console.error('Patient ID is missing in route');
      }
    });
  
  }

  private getById(PatientId: number) {
    this.ThoraciqueService.getById(PatientId).subscribe(
      (data: any) => {
        // Ensure data is an array
        if (Array.isArray(data)) {
          this.complications = data;
        } else {
          this.complications = [data]; // Convert to array if single object is returned
        }
        console.log('Formatted data:', this.complications);
      },
      (error: HttpErrorResponse) => {
        this.errorMessage = error.message;
        console.error('Error fetching complication data:', error);
      }
    );
  }

  onSubmit() {
  const patientID = parseInt(this.route.snapshot.paramMap.get('PatientID')!, 10);

  if (!isNaN(patientID)) {
    // Iterate through each complication and update it
    const updateObservables: Observable<any>[] = this.complications.map(complication => {
      const compData: ComplicationThoraciqueAigu = {
        ...complication,
        PatientId: patientID
      };

      return this.ThoraciqueService.update(patientID, compData);
    });

    // Execute all update observables in parallel
    forkJoin(updateObservables).subscribe(
      responses => {
        console.log('All updates successful', responses);
        // this.router.navigate(['/']); // Adjust this to your desired route after successful update
      },
      (error: HttpErrorResponse) => {
        this.errorMessage = `Error Code: ${error.status}\nMessage: ${error.message}`;
        console.error('Error details:', error.error);
      }
    );
  } else {
    console.error('Invalid patient ID:', patientID);
  }
}

  addComplication() {
    this.complications.push({});
  }
}

